INSERT INTO `product` VALUES (1,'Laptop Asus VivoBook A415EA EB1750W','laptop-asus-vivobook-a415ea-eb1750w','laptop-asus-vivobook-a415ea-eb1750w.png','http://localhost:8080/img/shop/products/laptop-asus-vivobook-a415ea-eb1750w.png','https://www.youtube.com/watch?v=gIHD6vyiXEQ','<h2><span style=\"font-size:22px\"><strong>Đ&aacute;nh gi&aacute; chi tiết laptop&nbsp;ASUS VivoBook A415EA EB1750W</strong></span></h2>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:18px\">Bạn đang t&igrave;m kiếm một chiếc <a href=\"https://gearvn.com/pages/laptop-van-phong\">laptop văn ph&ograve;ng</a> với hiệu năng ổn định đem lại khả năng xử l&yacute; mượt m&agrave; c&aacute;c t&aacute;c vụ cơ bản c&ugrave;ng một mức gi&aacute; phải chăng. Vậy h&atilde;y đến với <strong>VivoBook A415EA EB1750W</strong>, chiếc laptop d&agrave;nh cho học sinh - sinh vi&ecirc;n v&agrave; văn ph&ograve;ng đến từ ASUS. H&atilde;y c&ugrave;ng GEARVN kh&aacute;m ph&aacute; laptop ngay sau đ&acirc;y nh&eacute; !</span></p>\n\n<h3><span style=\"font-size:20px\"><strong>Thiết kế c&aacute; t&iacute;nh</strong></span></h3>\n\n<p><span style=\"font-size:18px\">Tối ưu d&agrave;nh cho m&ocirc;i trường l&agrave;m việc văn ph&ograve;ng, <a href=\"https://gearvn.com/collections/laptop-asus-vivobook-series\" target=\"_blank\">Asus&nbsp;VivoBook</a> A415EA EB1750W giữ vững phong c&aacute;ch thiết kế đơn giản nhưng vẫn sang trọng của d&ograve;ng laptop văn ph&ograve;ng: Với mặt A của laptop l&agrave;m từ nh&ocirc;m v&agrave; kho&aacute;c l&ecirc;n m&igrave;nh lớp m&agrave;u bạc sang trọng. Ngo&agrave;i ra, VivoBook A415EA EB1750W mang lại trọng lượng chỉ 1.4 kg v&agrave; mỏng 1.79 cm, vừa vặn cho bạn thuận tiện cất v&agrave;o balo v&agrave; mang đi l&agrave;m việc mọi nơi.</span></p>\n\n<p style=\"text-align: center\"><img src=\"//file.hstatic.net/1000026716/file/post-01_d6835213977840ca84a4d58a12549064_1024x1024.jpg\" /></p>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">CPU:&nbsp;</span>Intel Core i3-1115G4 1.7GHz up to 4.1GHz 6MB</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">RAM:&nbsp;</span>8GB DDR4 2666MHz&nbsp;Onboard</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Card đồ họa:&nbsp;</span>Intel UHD Graphics</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Ổ cứng:&nbsp;</span>256GB&nbsp;<a href=\"https://gearvn.com/collections/ssd-o-cung-the-ran\">SSD</a>&nbsp;M.2 PCIE G3X4 (C&ograve;n trống 1 khe SSD M.2 PCIE)</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">M&agrave;n h&igrave;nh:&nbsp;</span>14&quot; FHD (1920 x 1080), IPS, Anti-Glare with 45% NTSC,&nbsp;NanoEdge</li>\n</ul>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Audio:&nbsp;</span>\n	<ul>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">&nbsp;</span>Audio by ICEpower&reg;</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">Built-in speaker</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">Built-in microphone//harman/kardon (Mainstream)</li>\n	</ul>\n	</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Kết nối kh&ocirc;ng d&acirc;y:&nbsp;</span>Intel Wi-Fi 6(Gig+)(802.11ax), Bluetooth&nbsp;v5.0</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Webcam:&nbsp;</span>HD Web Camera</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">Cổng giao tiếp:&nbsp;\n	<ul>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1 x Type-A USB 3.2 Gen 1</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1 x Type-C USB 3.2</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">2 x USB 2.0 port(s)</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1 x HDMI 1.4</li>\n	</ul>\n	</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">Hệ điều h&agrave;nh:&nbsp;Windows 11 Home</li>\n</ul>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Trọng lượng:&nbsp;</span>1.4 kg</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">K&iacute;ch thước:&nbsp;324 x 215 x 17.9 mm</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">B&agrave;n ph&iacute;m: Kh&ocirc;ng Led</li>\n</ul>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">Pin:&nbsp;3 Cells 42WHrs</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">Kết nối LAN: Kh&ocirc;ng</li>\n</ul>\n',14990000,1000,_binary '',1,1,4,'2022-07-24 07:13:10','minhnh'),(2,'Laptop ASUS Vivobook Flip TP470EA EC346W','laptop-asus-vivobook-flip-tp470ea-ec346w','laptop-asus-vivobook-flip-tp470ea-ec346w.png','http://localhost:8080/img/shop/products/laptop-asus-vivobook-flip-tp470ea-ec346w.png','https://www.youtube.com/watch?v=dFLnMsJ5DmI&t','<h2><span style=\"font-size:20px;\"><strong>Đ&aacute;nh gi&aacute; chi tiết laptop ASUS Vivobook Flip TP470EA EC346W</strong></span></h2>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:18px;\">Bạn đang t&igrave;m một chiếc laptop văn ph&ograve;ng gi&aacute; rẻ nhưng vẫn sở hữu những đặc điểm, chức năng v&ocirc; c&ugrave;ng hữu &iacute;ch cho c&ocirc;ng việc như c&oacute; thể gập 360 độ, m&agrave;n h&igrave;nh cảm ứng. Vậy th&igrave; h&atilde;y đến với chiếc laptop&nbsp;<strong>ASUS Vivobook Flip TP470EA EC346W</strong>&nbsp;v&agrave; ngay sau đ&acirc;y c&ugrave;ng GEARVN t&igrave;m hiểu về &ldquo;em n&oacute;&rdquo; nh&eacute; !</span></p>\n\n<h3><span style=\"font-size:20px;\"><strong>Thiết kế tao nh&atilde;, sang trọng</strong></span></h3>\n\n<p><span style=\"font-size:18px;\">Sở hữu n&eacute;t đặc trưng của d&ograve;ng&nbsp;<a href=\"https://gearvn.com/collections/laptop-asus-van-phong-pho-thong\">laptop ASUS văn ph&ograve;ng</a>, Vivobook Flip TP470EA EC346W được kho&aacute;c l&ecirc;n lớp m&agrave;u bạc sang trọng, t&ocirc; điểm v&agrave; l&agrave;m nổi bật cho chiếc laptop. C&ugrave;ng với logo ASUS Vivobook được cắt tr&ecirc;n mặt A của&nbsp;<a href=\"https://gearvn.com/collections/laptop\">laptop</a>, khẳng định thương hiệu của d&ograve;ng&nbsp;<a href=\"https://gearvn.com/collections/laptop-asus\">laptop ASUS</a>. Với Vivobook Flip TP470EA EC346W, bạn c&oacute; thể đồng h&agrave;nh c&ugrave;ng chiếc laptop mọi nơi, dễ d&agrave;ng mang theo c&ugrave;ng balo nhờ v&agrave;o trọng lượng chỉ 1.5&nbsp;kg v&agrave; độ mỏng chỉ 1.87 cm.</span></p>\n\n<p style=\"text-align: center\"><img src=\"https://file.hstatic.net/1000026716/file/gearvn-laptop-asus-vivobook-flip-tp470ea-ec346w-ss2_3874b7acb3244156ab0ac075bcde7a8a.jpg\" /></p>\n\n<h3>&nbsp;</h3>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">CPU:&nbsp;</span>Intel Core i3-1115G4 1.7GHz up to 4.1GHz 6MB</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">RAM:&nbsp;</span>4GB LPDDR4X 3200MHz Onboard</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Card đồ họa:&nbsp;</span>Intel UHD Graphics</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Ổ cứng:&nbsp;</span>512GB&nbsp;<a href=\"https://gearvn.com/collections/ssd-o-cung-the-ran\">SSD</a>&nbsp;M.2 PCIE G3X4</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">M&agrave;n h&igrave;nh:&nbsp;</span>14&quot; FHD (1920 x 1080), Touch, IPS-level Panel, Glossy display, 250nits, NTSC: 45%, Screen-to-body ratio: 82 %, With stylus support</li>\n</ul>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Audio:&nbsp;</span>SonicMaster</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Kết nối kh&ocirc;ng d&acirc;y:&nbsp;</span>WiFi 6 (802.11 AX), Bluetooth v5.0</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Webcam:&nbsp;</span>720p HD camera</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">Cổng giao tiếp:&nbsp;\n	<ul>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1x Thunderbolt&trade; 4 supports display / power delivery</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1x USB 3.2 Gen 2 Type-A</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1x USB 2.0 Type-A</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1x HDMI 1.4</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1x 3.5mm Combo Audio Jack</li>\n		<li class=\"d-flex justify-content-between pb-2 border-bottom\">1x DC-in</li>\n	</ul>\n	</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">Hệ điều h&agrave;nh:&nbsp;Windows 11 Home</li>\n</ul>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Trọng lượng:&nbsp;</span>1.5&nbsp;kg</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">K&iacute;ch thước:&nbsp;32.40 x 22.00 x 1.87 ~ 1.87 cm</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">B&agrave;n ph&iacute;m: LED Trắng</li>\n</ul>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">Pin:&nbsp;3 Cells 42WHrs</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\">Kết nối LAN: Kh&ocirc;ng</li>\n</ul>\n',15890000,1000,_binary '',1,1,4,'2022-07-24 07:12:39','minhnh'),(3,'Laptop Asus Vivobook OLED A515EA L12033W','laptop-asus-vivobook-a515ea-l12033w','laptop-asus-vivobook-a515ea-l12033w.png','http://localhost:8080/img/shop/products/laptop-asus-vivobook-a515ea-l12033w.png','https://www.youtube.com/watch?v=ab4TeyIsllE&t','<h2><span style=\"font-size:20px;\"><strong>Đ&aacute;nh gi&aacute; chi tiết laptop ASUS Vivobook A515EA L12033W</strong></span></h2>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:18px;\"><a href=\"https://gearvn.com/collections/laptop-asus-vivobook-series\" target=\"_blank\">ASUS VivoBook</a>&nbsp;A515EA L12033W mang đến sự tinh tế v&agrave; tr&agrave;n đầy sức sống cho việc sử dụng m&aacute;y t&iacute;nh h&agrave;ng ng&agrave;y với m&agrave;u sắc bắt mắt v&agrave; ph&iacute;m Enter viền v&agrave;ng neon độc đ&aacute;o.&nbsp;</span></p>\n\n<p style=\"text-align: center\"><img src=\"//file.hstatic.net/1000026716/file/gearvn-laptop-asus-vivobook-a515ea-l12033w-0_ce68a7d02e0f438a9e33cc910b26f33b_grande.jpg\" style=\"width: 600px; height: 500px;\" /></p>\n\n<p><span style=\"font-size:18px;\">VivoBook 15&nbsp;được trang bị bộ vi xử l&yacute; Intel&reg; Core &trade; i5 Tiger Lake thế hệ thứ 11, cung cấp cho bạn c&aacute;c chức năng mạnh mẽ cần thiết để ho&agrave;n th&agrave;nh bất kỳ t&aacute;c vụ n&agrave;o. Ngo&agrave;i ra, chức năng cảm biến v&acirc;n tay sẽ gi&uacute;p bạn đăng nhập dễ d&agrave;ng v&agrave; n&acirc;ng cao khả năng bảo mật cho m&aacute;y t&iacute;nh.</span></p>\n\n<h3><span style=\"font-size:20px;\"><strong>Thiết kế ấn tượng từ c&aacute;i nh&igrave;n đầu ti&ecirc;n</strong></span></h3>\n\n<p><span style=\"font-size:18px;\">Nắp kim loại của VivoBook 15 đang ph&aacute; vỡ mọi giới hạn v&agrave; thiết lập c&aacute;c ti&ecirc;u chuẩn mới. Thiết kế n&agrave;y đ&atilde; trở th&agrave;nh tuy&ecirc;n ng&ocirc;n của genZ. Bạn l&agrave; người c&aacute; t&iacute;nh, thanh lịch, thời thượng&nbsp;th&igrave; &ldquo;đen đ&aacute; kh&ocirc;ng đường&rdquo; sẽ l&agrave; sự lựa chọn tuyệt vời cho bạn.&nbsp;</span></p>\n\n<p style=\"text-align: center\"><img src=\"//file.hstatic.net/1000026716/file/gearvn-laptop-asus-vivobook-a515ea-l12033w-3_3bc383a7608c4da7b9d98858aa3bfe7e_grande.jpg\" style=\"width: 600px; height: 500px;\" /></p>\n\n<p><span style=\"font-size:18px;\">Ngo&agrave;i ra, ph&iacute;m Enter được kết hợp khung v&agrave;ng Neon nổi bật gi&uacute;p chiếc laptop của bạn trở n&ecirc;n đặc biệt v&agrave; nổi bật hơn.</span></p>\n\n<p><span style=\"font-size:18px;\">ASUS Vivobook A515EA L12033W cho ph&eacute;p bạn l&agrave;m việc hiệu quả v&agrave; giải tr&iacute; mọi l&uacute;c mọi nơi. Tổng trọng lượng của VivoBook 15 chỉ 1,8 kg, si&ecirc;u mỏng 17,9 mm, c&oacute; thể đặt gọn g&agrave;ng trong t&uacute;i x&aacute;ch để bạn dễ d&agrave;ng mang theo bất cứ đ&acirc;u.</span></p>\n\n<h3>&nbsp;</h3>\n\n<p style=\"text-align: center\"><img src=\"//file.hstatic.net/1000026716/file/gearvn-laptop-asus-vivobook-a515ea-l12033w-8_c08d7525cd134a0eae90b5789bc8e361_grande.jpg\" style=\"width: 600px; height: 500px;\" /></p>\n\n<p><span style=\"font-size:18px;\">Viền si&ecirc;u mỏng NanoEdge mang đến trải nghiệm xem rộng hơn, đắm ch&igrave;m hơn v&agrave; được trang bị m&agrave;n h&igrave;nh lớn hơn trong khung m&aacute;y nhỏ hơn. M&agrave;n h&igrave;nh Full HD cho g&oacute;c nh&igrave;n rộng v&agrave; khả năng t&aacute;i tạo m&agrave;u sắc sống động, mang đến h&igrave;nh ảnh sống động hơn bao giờ hết.</span></p>\n','<ul class=\"list-unstyled fs-sm pb-2\">\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">CPU:&nbsp;</span>Intel Core i5-1135G7 up to 4.2GHz 8MB</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">RAM:&nbsp;</span>8GB DDR4 3200MHz Onboard (1x SO-DIMM socket, up to 16GB SDRAM)</li>\n	<li class=\"d-flex justify-content-between pb-2 border-bottom\"><span class=\"text-muted\">Card đồ họa:&nbsp;</span>Intel&reg; Iris